import{_ as e,o as p,c as t,d as a}from"./app-75535683.js";const c={},o=a('<h3 id="随笔0522" tabindex="-1"><a class="header-anchor" href="#随笔0522" aria-hidden="true">#</a> 随笔0522</h3><p>这两天因为吵架所以感觉很痛苦，上午上着班流鼻血了，感觉快要死掉了，心里想着，或许十秒后就死了 数着10 9 8 3 2 1 嘿嘿 没死，真坚强啊</p><p>我希望没有痛苦的死去 因为我不喜欢痛苦 我认为我每天想着死真的是一件很自私的事情，因为我死了会让真正在乎我的人更加痛苦，就好像把我的痛苦转移给了他们 但我一直活的好好的</p><p>我并没有放弃努力，只是最近感觉学的东西都好难，没有什么正反馈，所以做一些简单的事情。 看了一些小说，感觉我自己以后也能写一些书 心里装了很多东西 但一想写出来就有些困难，随缘吧 在练习打字，总感觉自己打字不够快。作为一个程序员，真是尴尬的事情 不过这种练习的反馈很及时 让我感觉自己还没有那么差，有些心理安慰,也获得了一些快乐。哈哈哈</p><p>时至今日，几乎是一事无成(世俗意义上)，自己的大部分目标也没有实现，自信心受到强烈的打击 但我只是很痛苦，真的超级无敌痛苦哇，但我好像还在坚持，即便已经烂成这样了，还是不想放弃（或许这算个优点）</p><p>一看课程就困得不行 最近在尝试喝咖啡。。。</p><p>想成为技术大佬</p><p>想成为滑板大佬</p><p>成为技术大佬可以让我有钱 也可以让我呆在程序这个圈子里工作 滑板大佬可以耍帅 装B</p><p>实现不了 太难了 种种原因 。。。。。</p>',10),r=[o];function n(s,_){return p(),t("div",null,r)}const i=e(c,[["render",n],["__file","Journal0522.html.vue"]]);export{i as default};
